【商品説明】<br>天然ゴムを手のひらにコーティングした、通気性に優れた背抜き手袋です。br特殊スベリ止め加工により、高いスベリ止め効果を発揮します。br天然ゴムを薄くコーティングすることにより、やわらかいフィット感を実現しました。br繊維部分は編み目が細かく縫い合わせのない、独自の13ゲージ・シームレス編み手袋です。br繊維部分には抗菌防臭加工を施しているため、汗臭くなりにくく、細菌の増殖を抑えます。br裾部分は、ほつれを防ぐオーバーロック加工を施しています。br特殊配合により、ブルーミング（白化現<br><br>商品サイズ：90×280×20<br><br>原材料・材質：天然ゴム<br><br>ご使用上の注意等：●アレルギー反応などにより、体質によっては、かゆみ・かぶれ・発疹等をおこすことがあります。異常を感じたら使用を中止し、医師に相談してください。br●高濃度の薬品や溶剤には、長時間使用しないでください。膨潤、浸透することがあります。br●油類がコーティング部分に付着した場合、劣化の原因となるため、できるだけ早めにふきとってください。br●熱いものに触れないでください。火傷するおそれがあります。br●刃物や鋭利なものを使用する作業には充分注意してください。br●回転体を伴う作業（ボール盤・面取り盤等）には使用しないでください。手が巻き込まれるおそれがあります。br●感電のおそれがあるため、電気作業には使用しないでくいださい。br●汚れた場合は洗濯し、陰干ししてください。保管する際には直射日光を避けてください。<br><br>●汚れた場合は洗濯し、陰干ししてください。保管する際には直射日光を避けてください。<br><br>原産国：マレーシア<br><br>問い合わせ先：ショーワグローブ株式会社 〒670-0802 兵庫県姫路市砥堀565 TEL (079)264-1234(代) お客様相談室 0120-641245（平日9：00～17：00）<br>商品区分：作業用手袋<br>JANコード：4901792017510<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
