バスロマン スキンケア ミルクプロテイン 680g(入浴剤)<br>ブランド：バスロマン<br>販売・製造元：アース製薬<br><br>天然エッセンスを配合した、お肌にやさしい薬用入浴剤シリーズ(肌荒れ対策用)です。<br>本品は、ミルクプロテインが角質層まで浸透し、お肌に必要なうるおいを与えます。<br>乾燥しやすいお肌、肌荒れお肌、白く粉ふくお肌をなめらかでスベスベに整え、湯上りのお肌をしっとりと保ちます。<br>ミルク(濁り)のお湯色、ミルクの香り。<br>アレルギーテスト済み(全ての方にアレルギーが起きないというわけではありません)。<br>医薬部外品。<br>  <br><br><br>使用方法<br>●ご家庭のお風呂のお湯(200L)に本品を30g溶かしてください。<br>(キャップの内枠一杯で約15gです。<br>)*赤ちゃんと一緒に入浴するときも使えます。<br> <br><br>使用上の注意<br>●入浴以外の用途には使用しないでください。<br>●皮膚あるいは体質に異常がある場合は、医師に相談の上使用してください。<br>●使用中や使用後、皮膚に発疹、発赤、かゆみ、刺激感などの異常が現れた場合、使用を中止し医師に相談してください。<br>●使用中、じんましん、息苦しさなどの異常が現れた場合には直ちに使用を中止し、医師または薬剤師に相談すること。<br>特にアレルギー体質の人や、薬などで発疹などの過敏症状を経験したことがある人は、充分注意して使用すること。<br>●本品は食べられません。<br>万一大量に飲み込んだときは、水を飲ませるなどの処置を 行ってください。<br>●本品は浴槽、風呂釜をいためるイオウは入っておりません。<br>●全自動給湯器、24時間風呂に使用するとフィルターがつまる可能性があるので、お使いの機種の説明書を確認の上使用すること。<br>●使用後は風呂釜内部や循環孔のフィルターなどが白く汚れることがありますので、よく水洗いすること。<br>(風呂釜内部の湯あかなどに白濁成分が一部つき、循環孔から浴槽内へ出ることがあります。<br>)●配合成分により、浴槽や洗い場ではすべりやすくなりますので、十分注意すること。<br>●残り湯を長く浴槽に入れておくと底がザラついたり、浴槽のまわりが白くなることがありますが、すすぎ洗いをするときれいになります。<br>●残り湯は洗濯にもお使いになれますが、すすぎは清水をお使いください。<br> ただし以下の場合は使用しないでください。<br>(柔軟仕上げ剤との併用、つけおき、おろしたての衣類)●残り湯を植物にかけると影響が出る可能性がありますので、かけないでください。<br>●使用後はふたをきちっと閉め、子供の手の届かないところに保管してください。<br>●自動計量充填ですから、空間があっても内容量は表示のとおりです。<br> <br>成分<br>有効成分：炭酸水素ナトリウム保湿成分：カゼインナトリウム指定成分：香料、パラベン、ポリオキシプロピレングリコール 効能・効果●荒れ性、あせも、しっしん、にきび、しもやけ、あかぎれ、冷え症、腰痛、 神経痛、リウマチ、疲労回復、肩のこり、うちみ、くじき、痔、産前産後の冷え症  入浴剤 スキンケアとはお肌にやさしい保湿成分・保護成分などを配合し、お肌のコンディションを整えるのに役立つ入浴剤です。<br><br>日用品／入浴剤・温浴器／入浴剤／薬用入浴剤 肌荒れ対策<br>JANコード： 4901080535313<br><br>CS：12<br>区分：医薬部外品<br>原産国：日本<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
